import React, { useState } from 'react';
import ABTestService from '../../services/api';
import { styled } from '@mui/material/styles';
import { Button, TextField, Container, Box, Typography } from "@mui/material";

const FormContainer = styled('form')({
  '& .MuiTextField-root': {
    margin: '8px',
    width: '25ch',
  },
});

const LineInput = styled(TextField)({
  '& .MuiInputBase-root': {
    border: 'none',
    borderBottom: '1px solid rgba(0, 0, 0, 0.42)',
  },
});

const CreateTest: React.FC = () => {
  const [campaignData, setCampaignData] = useState({
    campaignName : '', 
    controlName: '',
    controlIdentifier: '',
    type: '',
    variants: [
      {
        name: '',
        identifier: '',
      } 
    ]
  });

  const handleInputChange = (event: React.ChangeEvent<HTMLInputElement>) => {
    const { name, value } = event.target;
    setCampaignData((prevData) => ({
      ...prevData,
      [name]: value,
    }));
  };

  const handleVariantChange = (event: React.ChangeEvent<HTMLInputElement>, index: number) => {
    const { name, value } = event.target;
    const updatedVariants = [...campaignData.variants];
    updatedVariants[index] = {
      ...updatedVariants[index],
      [name]: value
    };
    setCampaignData((prevData) => ({
      ...prevData,
      variants: updatedVariants
    }));
  };

  const handleAddVariant = () => {
    const newVariant = {
      name: '',
      identifier: '',
    };
    setCampaignData((prevData) => ({
      ...prevData,
      variants: [...prevData.variants, newVariant]
    }));
  };

  const handleSubmit = async (event: React.FormEvent<HTMLFormElement>) => {
    event.preventDefault();

    try {
      await ABTestService.createCampaign(campaignData);
      alert('Test created successfully');
    } catch (error) {
      console.error('Error creating test:', error);
      alert('Failed to create test');
    }
  };

  return (
    <Container maxWidth="sm">
      <FormContainer noValidate autoComplete="off" onSubmit={handleSubmit}>
        <Box mb={3}>
          <Typography variant="h6" component="h2">
            Set Up Campaign
          </Typography>
  
          <LineInput
            id="campaign_name"
            label="Campaign Name"
            name="campaignName"
            value={campaignData.campaignName}
            onChange={handleInputChange}
            variant="outlined"
            fullWidth
            required
          />
  
          <TextField
            id="type"
            select
            label="Cmapaign Type"
            name="type"
            value={campaignData.type}
            onChange={handleInputChange}
            SelectProps={{ native: true }}
            variant="outlined"
            fullWidth
          >
            <option value="">Select</option>
            <option value="headline">Headline</option>
            <option value="teaser">Teaser Image</option>
            <option value="custom">Custom</option>
          </TextField>
  
          <LineInput
            id="control_name"
            label="Control Name"
            name="controlName"
            value={campaignData.controlName}
            onChange={handleInputChange}
            variant="outlined"
            fullWidth
            required
          />
  
          <LineInput
            id="control_identifier"
            label="Control CSS Selector"
            name="controlIdentifier"
            value={campaignData.controlIdentifier}
            onChange={handleInputChange}
            variant="outlined"
            fullWidth
            required
          />
  
          <Typography variant="h6" component="h2" sx={{ mt: 2 }}>
            Create Variants
          </Typography>
  
          {campaignData.variants.map((variant, variantIndex) => (
            <Box key={variantIndex} mb={3}>
              <TextField
                id={`variant-name-${variantIndex}`}
                label="Variant Name"
                name="name"
                value={variant.name}
                onChange={(event: React.ChangeEvent<HTMLInputElement>) =>
                  handleVariantChange(event, variantIndex)
                }
                variant="outlined"
                fullWidth
                required
              />
  
              <LineInput
                id={`variant-identifier-${variantIndex}`}
                label={campaignData.type === 'headline' ? "New Headline" : campaignData.type === 'teaser' ? "New Image Source" : "CSS Selector"}
                name="identifier"
                value={variant.identifier}
                onChange={(event: React.ChangeEvent<HTMLInputElement>) =>
                  handleVariantChange(event, variantIndex)
                }
                variant="outlined"
                fullWidth
              />
            </Box>
          ))}
  
          <Button
            variant="outlined"
            color="primary"
            onClick={handleAddVariant}
            sx={{ mt: 2 }}
          >
            Add Variant
          </Button>
        </Box>
  
        <Button variant="contained" color="primary" type="submit">
          Create Test
        </Button>
      </FormContainer>
    </Container>
  );
};

export default CreateTest;
